import React from 'react';
import '../App.css';
import Story from '.';


const Stories = ({ stories, onArchive }) =>
     <div className="stories" >
    {(stories || []).map(story =>
        <Story 
        key={story.objectID}
        story={story} 
        onArchive={onArchive}/>
    )}
  </div>

export default App;
